import randomclass Producto:    def _init_(self,nombre,tipo,precio,existencia=0):        self.ID = random.randint(1,100)        self.__Nombre = nombre        self.__Tipo = tipo        self.__Precio = precio        self.__Existencia = existencia            def Modificar_Ex(self,No):        if (self.Existencia == self.Existencia + No) >= 0:            self.Existencia= self.Existencia + No        else:            print("Error, no existen tantos elementos")#Se cambia por la Interfaz                def Establecer_Precio(self,Num):        self.Precio=Num            def Guardado(self):        passclass Inventario:     def _init_(self,lista_p=[]):        self.productos = lista_p        self.Total_P = len(lista_p)             def Agregar_E_P(self,nombre,existencia):        for x in self.productos:            if x.Nombre == nombre:                x.Modificar_Ex(existencia)            else:                print("No encontrado") #Nota, se necesita cambiar a Interfaz                def Quitar_E_P(self,nombre,existencia):        for x in self.productos:            if x.Nombre == nombre:                x.Modificar_Ex(-existencia)            else:                print("No encontrado") #Nota, se necesita cambiar a Interfaz        def Crear_P(self,Nombre,Tipo,Precio):        self.productos.append(Producto(Nombre,Tipo,Precio))        def Eliminar_P(self,nombre):        for x in self.productos:            if x.Nombre == nombre:                self.productos.pop(x)                del x                    def Guardado(self):        pass        class Venta:    def _init_(self,fecha,hora):        self.ID_V = random.randint(1,1000)        self.Fecha = fecha        self.Hora = hora            def Cancelar_Venta(self):        pass        def Do_Devolucion(self,inventario,nombre):        inventario.Agregar_E_P(nombre,existencia=1)            def Guardado(self):        pass